import ProductMovement from "../pages/ProductMovement";
import Products from "../pages/Products";

const routes = [
{
    path: "/",
    exact: true,
    component: Products
},
{
    path: "/Movements",
    exact: true,
    component: ProductMovement
},
]

export default routes;
